# Tatil, Republic of Dagestan

}}
Tatil (; ) is a rural locality (a selo) in Khapilsky Selsoviet, Tabasaransky District, Republic of Dagestan, Russia. Population:  There are 7 streets.
Geography
Tatil is located 7&nbsp;km northeast of Khuchni (the district's administrative centre) by road. Khapil is the nearest rural locality.
